import React from "react";
import style from "./Wrapper.module.css";

const Wrapper = props => {
  return;
  <>
    <div
      style={{
        position: "absolute",
        width: "100vh",
        height: "100vw",
        backgroundColor: "#ccc",
        zIndex: 999999
      }}
    ></div>
    <div className={style.main_wrapper}>{props.children}</div>;
  </>;
};

export default Wrapper;
